import React from "react";
import Calendar from "./components/Calendar";
import "./App.css";

import logo from './logo.jpeg'; // with import






class App extends React.Component {
  render() {
    return (
      <div className="App">
        <header>
          <div id="logo">
            <span className="icon">date_range</span>
            <span>
              react<b>calendar</b>
            </span>

          </div>
        </header>
        <main>
        <img src={logo} />
          <Calendar />
          <img src={logo} />

        </main>
      </div>
    );
  }
}

export default App;
